import React, { Fragment } from 'react';
import { useSelector } from 'react-redux';
import { DeleteAlart } from './DeleteListAlart';
import { EditAlart } from './EditTodo';
import { Menu, Transition } from '@headlessui/react';
import { ChevronDownIcon } from '@heroicons/react/20/solid';
import classNames from 'classnames';

const TodoList = () => {
    const todoItems = useSelector((state) => state.todo.value);

    return (
        <div className="container mx-auto">
            <div className="my-5 p-2">
                <table className="table-auto w-full text-left text-dark">
                    <thead>
                    <tr className="mt-3">
                        <th className="px-4 py-2">No</th>
                        <th className="px-4 py-2">Task Name</th>
                        <th className="px-4 py-2">Status</th>
                        <th className="px-4 py-2">Edit</th>
                        <th className="px-4 py-2">Remove</th>
                    </tr>
                    </thead>
                    <tbody>
                    {todoItems.map((item, i) => {
                        if (typeof item === 'string' && item.trim() !== '') {
                            return (
                                <tr className="" key={i.toString()}>
                                    <td className="px-4 py-2">{i + 1}</td>
                                    <td className="px-4 py-2">{item}</td>
                                    <td className="px-4 py-2">
                                        <Menu as="div" className="relative inline-block text-left">
                                            <div>
                                                <Menu.Button className="inline-flex w-full justify-center gap-x-1.5 rounded-md bg-white px-3 py-2 text-sm font-semibold text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-indigo-500">
                                                    Options
                                                    <ChevronDownIcon className="-mr-1 h-5 w-5 text-gray-400" aria-hidden="true" />
                                                </Menu.Button>
                                            </div>
                                            <Transition
                                                as={Fragment}
                                                enter="transition ease-out duration-100"
                                                enterFrom="transform opacity-0 scale-95"
                                                enterTo="transform opacity-100 scale-100"
                                                leave="transition ease-in duration-75"
                                                leaveFrom="transform opacity-100 scale-100"
                                                leaveTo="transform opacity-0 scale-95"
                                            >
                                                <Menu.Items className="absolute right-0 z-10 mt-2 w-56 origin-top-right rounded-md bg-white shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
                                                    <Menu.Item>
                                                        {({ active }) => (
                                                            <a
                                                                href="#"
                                                                className={classNames(
                                                                    active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                                    'block px-4 py-2 text-sm hover:bg-gray-100'
                                                                )}
                                                            >
                                                                Pending
                                                            </a>
                                                        )}
                                                    </Menu.Item>
                                                    <Menu.Item>
                                                        {({ active }) => (
                                                            <a
                                                                href="#"
                                                                className={classNames(
                                                                    active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                                    'block px-4 py-2 text-sm hover:bg-gray-100'
                                                                )}
                                                            >
                                                                Ongoing
                                                            </a>
                                                        )}
                                                    </Menu.Item>
                                                    <Menu.Item>
                                                        {({ active }) => (
                                                            <a
                                                                href="#"
                                                                className={classNames(
                                                                    active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                                    'block px-4 py-2 text-sm hover:bg-gray-100'
                                                                )}
                                                            >
                                                                Canceled
                                                            </a>
                                                        )}
                                                    </Menu.Item>
                                                    <Menu.Item>
                                                        {({ active }) => (
                                                            <button
                                                                type="submit"
                                                                className={classNames(
                                                                    active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                                    'block w-full px-4 py-2 text-left text-sm hover:bg-gray-100'
                                                                )}
                                                            >
                                                                Completed
                                                            </button>
                                                        )}
                                                    </Menu.Item>
                                                </Menu.Items>
                                            </Transition>
                                        </Menu>
                                    </td>
                                    <td className="px-4 py-2">
                                        <button
                                            onClick={() => {
                                                EditAlart(i, item);
                                            }}
                                            className="btn btn-sm btn-primary text-light"
                                        >
                                            Edit
                                        </button>
                                    </td>
                                    <td className="px-4 py-2">
                                        <button
                                            onClick={() => {
                                                DeleteAlart(i);
                                            }}
                                            className="btn-sm btn btn-danger text-light"
                                        >
                                            Remove
                                        </button>
                                    </td>
                                </tr>
                            );
                        } else {
                            return null;
                        }
                    })}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default TodoList;
